import React from "react";

import "./Chart.css";

import ChartBar from "./ChartBar";

const Chart = (props) => {
  return (
    <div className="chart">
      {props.expense.map((dataPoint) => {
        return <ChartBar value={dataPoint.value} maxValue={null}  label = {dataPoint.label}/>;
      })}
    </div>
  );
};

export default Chart;
